vec4 Effect2(vec2 uv) {
    // Create cellular pattern with noise and time-based animation
    vec2 st = uv * 10.0;
    vec2 cellCenter = fract(st - 0.5) * PI;
    float cellDist = length(cellCenter);

    // Add noise distortion to coordinates
    vec2 noiseCoords = uv + turbulent(vec3(uv * 2.0, iTime)) * 0.1;
    float noiseValue = noise(noiseCoords);

    // Create color transitions using HSL
    vec3 color1 = hsl(cellDist * 0.5 + iTime * 0.1, 0.7, 0.6);
    vec3 color2 = hsl(cellDist * 0.5 + iTime * 0.1 + PI/2.0, 0.7, 0.6);

    // Combine patterns with turbulence
    float pattern = turbulent(vec3(uv * 4.0, iTime)) * 0.5 + 0.5;
    vec3 finalColor = mix(color1, color2, pattern);

    // Add depth and layers
    vec2 cellCenter2 = fract(st - 0.5 + noiseValue) * PI;
    float cellDist2 = length(cellCenter2);
    finalColor += hsl(cellDist2 * 0.3 + iTime * 0.1, 0.4, 0.8) * 0.3;

    return vec4(finalColor, 1.0);
}
